// イベントハンドラにおいてpropsの読み取りを実施したいと思います。

function Button({onSmash,children}){
  return(
    <button onClick={onSmash}>
      {children}
    </button>
  );
}



export default function App(){
  return (
  <div>
    <Button onSmash={()=>alert('Smash!')}>Smash</Button>
